import React from 'react';
import axios from 'axios';



export default class Scrape extends React.Component {

    componentDidMount() {
      axios.get(`http://127.0.0.1:3000/scrape`)
        .then(res => {
          const imgVdData = res.data;
          this.setState({ imgVdData });
        }).catch((e)=>{
            console.log(e);
            this.setState({ e });
        });
    }

    render() {
      return (
        <ul>
          { this.state.imgVdData.map(data => <li>{data}</li>)}
        </ul>
      )
    }
  }
